import React from "react";
import styles from "./Home.module.css";

import $ from "jquery";
import OwlCarousel from 'react-owl-carousel2';
import 'react-owl-carousel2/src/owl.carousel.css';

class HomePage extends React.Component {
  componentDidMount() {
    console.log(document.getElementById("slider"));
  }
  render() {
    const options = {
      items: 1,
      nav: true,
      rewind: true,
      autoplay: true,
      loop: true,
    };
    return (
      <div id="HomePage">
        {/* <!-- SLIDER SECTION ---> */}
        <div className="zmovo-slider-area">
        <OwlCarousel ref="car" options={options} >
    <div><img src="/img/fullimage1.jpg" alt="The Last of us"/></div>
    <div><img src="/img/fullimage2.jpg" alt="GTA V"/></div>
    <div><img src="/img/fullimage3.jpg" alt="Mirror Edge"/></div>
</OwlCarousel>
        </div>
        {/* <!-- END SLIDER SECTION ---> */}
      </div>
    );
  }
}

export default HomePage;
